import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import logo from '../assets/logo.png';
import { Navbar, Nav, Form, FormControl, Button, Container, 
         Collapse, NavDropdown, Offcanvas, Image } from 'react-bootstrap';
import '../css/header.css';
import { FaUserCircle } from "react-icons/fa";

const CinemaHeader: React.FC = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [searchQuery, setSearchQuery] = useState('');
    const location = useLocation();

    // Toggle Menu
    const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

    // Handle Search
    const handleSearch = (e: React.FormEvent) => {
        e.preventDefault();
        console.log('Searching for:', searchQuery);
        // Add search logic here (e.g., API call or navigation)
    };

    const isActive = (path: string) => location.pathname === path;

    return (
        <>
          {['sm'].map((expand) => (
            <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
            <Container fluid>
                <Image src={logo} className=' mx-2' style={{width:'70px'}}  alt="logo" roundedCircle />                
                <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
                <Navbar.Offcanvas
                id={`offcanvasNavbar-expand-${expand}`}
                aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
                placement="end"
                >
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                    Offcanvas
                    </Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    <Nav className="justify-content-center flex-grow-1 pe-3">
                    <Nav.Link href="#action1"><strong>Phim</strong></Nav.Link>
                    <Nav.Link href="#action2"><strong>Rạp/Giá vé</strong></Nav.Link>
                    <Nav.Link href="#action2"><strong>Lịch chiếu</strong></Nav.Link>
                    <Nav.Link href="#action2"><strong>Sự kiện/Tin tức</strong></Nav.Link>
                    <NavDropdown
                        title={
                            <>
                                 Tài khoản <FaUserCircle size={25}/>
                            </>
                        }
                        id={`offcanvasNavbarDropdown-expand-${expand}`}
                    >
                        <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                        <NavDropdown.Item href="#action4">
                        Another action
                        </NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="#action5">
                        Something else here
                        </NavDropdown.Item>
                    </NavDropdown>
                    </Nav>
                    <Form className="d-flex search-form">
                        <div className="input-group">
                            <Form.Control
                                type="search"
                                placeholder="Search..."
                                className="rounded-pill search-input"
                                aria-label="Search"
                            />
                            <Button variant="success" className="rounded-pill search-button">
                                <i className="bi bi-search"></i>
                            </Button>
                        </div>
                    </Form>
                </Offcanvas.Body>
                </Navbar.Offcanvas>
            </Container>
            </Navbar>
        ))}
        </>
      );
};

export default CinemaHeader;
